DECLARE var_fin TIME DEFAULT '09:00:00';
DECLARE var_incremento TIME DEFAULT '01:30:00';
DECLARE var_descanso TIME DEFAULT '03:30:00';
DECLARE var_precio DECIMAL (5,2); 

SELECT TIMESTAMPDIFF(DAY, v_desde, v_hasta) INTO var_dias;
SELECT tipo FROM pistas WHERE id = v_pista INTO var_tipo;
IF EXISTS (SELECT * FROM pistas 
              WHERE id=v_pista) THEN
	WHILE (var_i<=var_dias ) DO
