        		SET var_inicio = '08:00:00';
        		SET var_fin='09:00:00';
       			SET var_incremento = '01:00:00';
        		SET var_descanso = '03:00:00';
                SELECT precio_hora FROM pistas WHERE id = v_pista INTO var_precio;
        	ELSE
        		SET var_inicio='07:30:00';
